import React, { Component } from 'react';
import { Card, Button } from 'react-bootstrap';

export default class KarticaVijesti extends Component {
	render() {
		return (
			<React.Fragment>
				<Card className="kartica-vijest">
					<Card.Img src={this.props.slika} />
					<Card.Body>
						<Card.Title>{this.props.naslov}</Card.Title>
						<Card.Text>{this.props.tekst}</Card.Text>
						<Button variant="primary">Pročitajte više</Button>
					</Card.Body>
				</Card>
			</React.Fragment>
		);
	}
}
